import GetItemsInfo from "./GetItemsInfo";
import MakeItem from "./MakeItem";

function MakeItemList({ arr }) {
  const { data } = GetItemsInfo();
  console.log(data);
  return (
    <ul>
      {arr.list.map((item) => {
        return (
          <li>
            <MakeItem item={item} />
          </li>
        );
      })}
    </ul>
  );
}

export default MakeItemList;
